import React, { useState } from 'react'
import TextField from '@mui/material/TextField';
import Button from '@mui/material/Button';



const Login = () => {
  const [formData, setFormData] = useState({
    email: "",
    password: ""
  })


  const onChangeFormData = (e) => {
    const name = e.target.name
    const value = e.target.value
    setFormData((val) => ({ ...val, [name]: value }))
  }

  const onSubmitFormData = async () => {
    try {
      const res = await lo(formData)
      console.log("formLogin", res)

    } catch (e) {
      console.log(e)
    }
  }

  const onFormSubmit = (e) => {
    e.preventDefault()
  }

  return (
    <div>
      <form onSubmit={onFormSubmit} >



        <TextField id="outlined-basic" label="Email" variant="outlined" name='email' style={{ margin: '15px' }} onChange={onChangeFormData} />
        <br />
        <TextField id="outlined-basic" label="Password" variant="outlined" name='password' style={{ margin: '15px' }} onChange={onChangeFormData} />
        <br />
        <Button variant="contained" style={{ margin: '15px' }} onClick={onSubmitFormData}>Register</Button>

      </form>
    </div>
  )
}

export default Login
